import { useState } from 'react';
import './App.css';
import { fetchHelloWorld } from './services/HelloWorldService';

let timer;

function App() {
    const [currentTime, setCurretTime] = useState(Date.now());
    const [label, setLabel] = useState(""); //pide un espacio en memoria
    const clickHandler = async () => {
        const result = await fetchHelloWorld();
        setLabel(result);
    };

    if (!timer) {
        timer = setInterval(() => {
            setCurretTime(Date.now());
        }, 1000);
    }

    return (
        <div className="App">
            {new Date(currentTime).toLocaleString()}
            <button onClick={() => clickHandler()}>Call API</button>
            {label}
        </div>
    );
}

export default App;
